import React from 'react'
import Headline from '../../layouts/form/headline'

const PublishedPassport = () => {
  return (
    <div className="mt-8">
        <Headline />
        <div className="mt-8">
        <ProgressBar progress="4"/>
      </div>
    </div>
  )
}

export default PublishedPassport
